var InputUrlModal = class extends import_obsidian3.Modal {
  constructor(app, onSubmit) {
    super(app);
    this.result = "";
    this.onSubmit = onSubmit;
  }
  onOpen() {
    const { contentEl } = this;
    new import_obsidian3.Setting(contentEl).setName("Feed Url:").setDesc("Enter the url of the rss feed:").setHeading().addText((text) => {
      text.inputEl.addEventListener("keyup", (evt) => {
        var _a;
        var keyCode = (_a = evt.code) != null ? _a : evt.key;
        if (keyCode === "Enter") {
          if (this.result) {
            this.close();
            this.onSubmit(this.result);
          }
          return false;
        }
      });
      text.inputEl.style.width = "95%";
      text.setPlaceholder("https://x.com/feed").onChange((value) => {
        this.result = value;
      });
    });
    new import_obsidian3.Setting(contentEl).addButton(
      (btn) => btn.setButtonText("Submit").setCta().onClick(() => {
        this.close();
        this.onSubmit(this.result);
      })
    );
  }
  onClose() {
    const { contentEl } = this;
    contentEl.empty();
  }
};
var UpdateRSSfeedCommand = class {
  constructor(app, plugin) {
    this.id = "rss-tracker-update-feed-checked";
    this.name = "Update RSS feed";
    this.app = app;
    this.plugin = plugin;
  }
  checkCallback(checking) {
    const active = this.app.workspace.getActiveFile();
    if (active) {
      const cfg = FeedConfig.fromFile(this.app, active);
      if (checking) {
        return cfg;
      }
      if (cfg) {
        this.plugin.feedmgr.updateFeed(cfg, true).then(() => new import_obsidian3.Notice(`${cfg.source.basename} updated!`));
        return true;
      }
    }
    return false;
  }
};
var MarkAllRSSitemsReadCommand = class {
  constructor(app, plugin) {
    this.id = "tracked-rss-mark-items-read-checked";
    this.name = "Mark all RSS feed items as read";
    this.app = app;
    this.plugin = plugin;
  }
  checkCallback(checking) {
    const active = this.app.workspace.getActiveFile();
    if (active) {
      const cfg = FeedConfig.fromFile(this.app, active);
      if (checking) {
        return cfg;
      }
      if (cfg) {
        this.plugin.feedmgr.markFeedItemsRead(cfg.source).then(() => new import_obsidian3.Notice(`${cfg.source.basename} updated!`));
        return true;
      }
    }
    return false;
  }
};
var NewRSSFeedModalCommand = class {
  constructor(app, plugin) {
    this.id = "rss-tracker-new-feed-url-input-modal";
    this.name = "New RSS feed";
    this.app = app;
    this.plugin = plugin;
  }
  callback() {
    const modal = new InputUrlModal(this.app, async (result) => {
      const f = this.app.workspace.getActiveFile();
      if (f) {
        const parent = this.app.fileManager.getNewFileParent(f.path);
        const mgr = this.plugin.feedmgr;
        const leaf = this.app.workspace.getLeaf(false);
        leaf.openFile(await mgr.createFeedFromUrl(result, parent));
      }
    });
    modal.open();
  }
};

